func Path_Generate(Type: String) -> URL{
    let fileManager = FileManager.default
    let documentsDirectory = fileManager.urls(for: .documentDirectory, in: .userDomainMask).first!
    let MisakaDocs = documentsDirectory.appendingPathComponent("Misaka")
    let Path = MisakaDocs.appendingPathComponent(Type)
    try? FileManager.default.createDirectory(atPath: Path.path, withIntermediateDirectories: true, attributes: nil)
    return Path
}
func rhb(in inputFile: String, out outputFile: String) throws {
    let inputData = try Data(contentsOf: URL(fileURLWithPath: inputFile))
    let reversedData = rhb(in: inputData)
    try reversedData.write(to: URL(fileURLWithPath: outputFile))
}
func rhb(in data: Data) -> Data {
    let reversed = Data(data.reversed())
    let reversedHex = reversed.map { byte in
        let hexString = String(format: "%02X", byte)
        let reversedHexString = hexString.reversed()
        return UInt8(String(reversedHexString), radix: 16)!
    }
    return Data(reversedHex)
}
